import axios from 'axios';

    const EMP_API="http://localhost:9856/api/property/add";

class PracSer{
 getEmp(){
    return axios.get(EMP_API);
 }
 createEmp(emp){
    return axios.get(EMP_API,emp);
 }
}
export default PracSer
